import React, { useState } from 'react';


function App() {

  const [arrNums, setArrNums] = useState([9, 1, 3, 2, 5, 6, 9, 4, 5, 7, 8]);
  const BubbleSort = () => {
    console.log(arrNums)
  }



  BubbleSort();
  return (

    <div className="App">

      <ul>
      {arrNums.map((rows, index) => {
        <li key={index}>{rows}</li>
      })}
      </ul>

    </div>
  );
}

export default App;
